import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Orders.css';

const Orders = () => {
  const navigate = useNavigate();

  return (
    <div className="orders-container">
      <h1 className="orders-title">My Orders</h1>
      <div className="orders-message-box">
        <p className="orders-message">No cars bought.</p>
        <button className="orders-browse-btn" onClick={() => navigate('/')}>Browse Cars</button>
      </div>
    </div>
  );
};

export default Orders;
